import React, { Component } from 'react';
//import { Link } from '@reach/router';
//import Firebase from './Firebase';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';


class Login extends Component {

  componentDidMount(){

  }

  render() {
    const { authAnon } = this.props;


    return (
      <div>
      <div className="page-header secondary"></div>

      <div className="d-flex flex-column container-fluid loginContainer">
        <h1>Welcome to Naxos</h1>
        <FontAwesomeIcon icon="heartbeat" size="6x"/>
      <div className="card text-center">
      <div className="card-header">
        Naxos
      </div>
      <div className="card-body">
        <h5 className="card-title">Naxos</h5>
        <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
        <a href="#" className="btn btn-secondary">Go somewhere</a>
      </div>
      <div className="card-footer text-muted">

      </div>
      </div>

      <button className="btn btn-dark mt-4" onClick={authAnon}>Log In Anonymously
      </button>
      </div>

      </div>
    );
  }
}

export default Login;
